import React, { Component } from 'react';
import './reset.css';
import './text.css';


// Assignment 8 - React app

class AssignApp8 extends Component {
  render() {
    return (
        <div className="AssignApp8">
        <header className="App-header">
        <table>
        <thead>
        <tr>
          <th>
              <p>Edit <code>src/AssignApp8.js</code> and save to reload.</p>
          </th>
        </tr>
        </thead>
            <tbody>
            <H2>><td>1 2 3 4</td></H2>
            <td>1 2 3 4</td>
            </tbody>
        </table>
        </header>
       </div>
    );
  }
}

export default AssignApp8;
